import React from 'react'


const Card = ({name, height, mass, eye_color, birth_year, gender, homeworld}) => {
    return (
        <div className="dib bg-light-purple ma3 pa3 shadow=5 br3">
            <img alt="wwwa" src={`https://robohash.org/${name}as`}/>
        <h1>{name}</h1>
        <p>Height: {height}</p>   
        <p>Mass: {mass}</p>   
        <p>Eye Color: {eye_color}</p>   
        <p>Birth Year: {birth_year}</p>   
        <p>Gender: {gender}</p>   
        <p>Homeworld: {homeworld.results}</p>    
        </div>
    )
};

export default Card
